import itertools; import math; import operator; import random; import re; from bisect import *; from collections import deque, defaultdict, Counter, OrderedDict; from heapq import *; import unittest; from typing import List
def get_sol(): return Solution()
class Solution:
    def numSub(self, s: str) -> int:
        length=len(s)
        left,right=0,0
        res=0
        while right<length:
            while right<length and s[right]!='1': # place left and right to starting of 1's
                right+=1
            left=right
            while right<length and s[right]=='1': # place right to the end of 1's
                right+=1
            n=right-left # no of 1's in the window
            res+= (n+1)*n//2
            res%=10**9+7
        return res
class Solution2:
    def numSub(self, s: str) -> int:
        n=len(s)
        cnt=0
        res=0
        for i in range(n):
            if s[i]=='1':
                cnt+=1
            else:
                cnt=0
            res+=cnt
            res%=10**9+7
        return res

